import React from 'react';
import { IContentProps } from '../types/types';
import TabContent from './TabContent';

const Content = (props: IContentProps): JSX.Element => {

    return (
        <>
           <div className="sidebar-content">
                <TabContent id='#home' heading='Home' faIcon='fa fa-caret-left' />
                <TabContent id='#database' heading='Database' faIcon='fa fa-caret-left' />
                <TabContent id='#settings' heading='Settings' faIcon='fa fa-caret-left' />
                <TabContent id='#off' heading='Log out' faIcon='fa fa-caret-left' />
           </div>
        </>
    )
}

export default Content;
